sys_variable_value.value:
(function execute(inputs, outputs) {
    var vpc = new GoogleVPCUtils();
    vpc.validateInputVariables(inputs, outputs);
    vpc.validateMandatoryVariables(inputs, ['projectid', 'region']);
    vpc.maptoOutputFromInput(inputs, outputs, ['projectid', 'region']);
    var requestBody = {
        "name": inputs.name,
        "network": "projects/" + inputs.projectid + "/global/networks/" + inputs.network,
        "ipCidrRange": inputs.ipcidrrange
    }
    outputs.requestbody = JSON.stringify(requestBody);
})(inputs, outputs);

